    m = len(T)
    if n < m:
        return 0
    dp = [[0] * (m + 1) for _ in range(n + 1)]
    for i in range(n + 1):
        dp[i][0] = 1
    for i in range(1, n + 1):
        for j in range(1, m + 1):
            p1 = dp[i - 2][j]
            p2 = 0
            if S[i - 1] == T[j - 1]:
                p2 = dp[i - 1][j - 1]
            dp[i][j] = (p1 + p2) % 1000000007
    return dp[n][m]

